**Ibjik #:** SCP-011-J-ID

**Kilis Ibjik:** Kitir

**Prisidir Kiiminin Khisis:** Sisiiring ying tirkini pinyikit psikiligis SCP-011-J-ID sigiri mingkin hiris dibiri imnistik simpii dii dipit birkiminikisi itii minilis dingin binir.

**Diskripsi:** SCP-011-J-ID idilih pinyikit psikiligi ying mimbiit pindiritinyi ikin mimbiit silirih hirif vikil diibih minjidi hirif i biik dilim minilis miipin birbiciri.

Jiki sisiiring minilis, mindingir, mimbici miipin birbiciri ying mimiliki hirif vikil i siciri tiris-miniris itii birbiciri/minilis tinting pinyikit ini, miki iring tirsibit ikin tirkini SCP-011-J-ID.

Iring ying tirkini SCP-011-J-ID ikin silili birbiciri ikin titipi simii kiti vikil ying diicipkin ikin biribih minjidi hirif i, bigiti pili jigi dilim hilnyi minilis. Simii hirif vikil pidi tilisin tingin miipin kitikin diri iring ying tirkini SCP-011-J-ID ikin biribih minjidi hirif i jigi wiliipin sidih ditilis dingin binir. Tidik dikitihii bigiimini hirif-hirif iti bisi biribih.

Dikirinikin pinilirinnyi ying miliwiti pinglihitin din pindingirin, iring ying tirkini SCP-011-J-ID diliring kiris intik birsisiilisisi dingin midii ipi pin intik minghindiri pinilirin.

**Limpirin 011-J-ID:**

&gt; //Pincigihin SCP-011-J-ID miming tirbiling midih nimin misih binyik iring ying tirkini pinyikit ini khisisnyi dilim birsisiil midii. Siyi hirip iring iring dipit birsisiil midii dingin bihisi ying biik, binir din tinti siji sipin//
&gt; 
&gt; //&#34;Tinggi, kinipi tilisinki birvikil i simii?&#34;//
&gt; //&#34;Siilin, iki tirkini SCP-011-J-ID jigi.&#34;//
